import React from 'react';
import elosaudeLogoBranco from '../assets/elosaudebranco.png'; // Verifique o caminho da sua imagem

const Footer = () => {
  const currentYear = new Date().getFullYear();

  return (
    <footer className="w-full bg-elosaude-dark text-white p-4">
      <div className="container mx-auto flex flex-col md:flex-row justify-between items-center text-sm">
        <div className="flex items-center space-x-2 mb-2 md:mb-0">
          <img src={elosaudeLogoBranco} alt="Logo Elosaúde Branco" className="h-6" />
        </div>
        <div className="text-center md:text-right">
          <p>© {currentYear} Elosaúde. Todos os direitos reservados.</p>
          <p>Desenvolvido por: Inovação Elosaúde</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
